set -e

opae=true
dfl=true
nogpg=false
y=false
force=false

longs="dfl-only,opae-only,nogpgcheck,force"
shorts="yf"
args="$@"
options=$(getopt -o "$shorts" -l "$longs" -- "$@") || exit 1
eval set -- "$options"

while true; do
  case "$1" in
    --dfl-only)
      opae=false
      shift
      ;;
    --opae-only)
      dfl=false
      shift
      ;;
    --nogpgcheck)
      nogpg=true
      shift
      ;;
    -y)
      y=true
      shift
      ;;
    -f|--force)
      force=true
      shift
      ;;
    --)
      shift
      break
      ;;
    \?)
      echo "invalid option: '$1'" >&2
      exit 1
      ;;
    *)
      echo "unknown option: '$1'" >&2
      exit 1
      ;;
  esac
done

installed() {
  rpm --quiet -q "$1"
}

check_kernel_headers() {
  for k in kernel kernel-rt; do
    if installed $k-$(uname -r) && ! installed "$k-devel-$(uname -r)" && ! $force; then
      echo "ERROR: $k-devel package is not installed for running kernel; aborting"
      echo ""
      echo "please take one of the following actions to resolve the issue:"
      echo " - run again with this check disabled: ./$(basename $MS_BUNDLE) -- $args --force"
      echo " - install needed kernel headers:      dnf install \"$k-devel-uname-r = $(uname -r)\""
      echo " - install the newest kernel image:    dnf install $k $k-devel && reboot"
      exit 1
    fi
  done
}

install_epel() {
  args=""
  $y && args="$args -y"

  if ! installed epel-release; then
    # redhat
    installed redhat-release && dnf install $args https://dl.fedoraproject.org/pub/epel/epel-release-latest-8.noarch.rpm

    # centos 8.2
    installed centos-release && dnf install $args epel-release

    # centos 8.3
    installed centos-linux-release && dnf install $args epel-release
  fi

  if ! installed epel-release; then
    echo "Failed to installed epel repository, which is needed to build kernel modules"
    exit 1
  fi
}

install_rpm() {
  args=""

  $nogpg && args="$args --nogpgcheck"
  $y     && args="$args -y"
  $opae  && args="$args opae-*.rpm"
  $dfl   && args="$args linux-dfl-backport-*.rpm"

  dnf install $args
}

main() {
  check_kernel_headers
  install_epel
  install_rpm
  systemctl enable --now dkms.service
}

main
